impl Solution {
    pub fn find_prime_pairs(n: i32) -> Vec<Vec<i32>> {
        let mut sieve = vec![true; n as usize + 1];
        let mut primes = Vec::new();

        for i in 2..sieve.len() {
            if sieve[i] {
                primes.push(i as i32);
                let mut j = i * i;
                while j < sieve.len() {
                    sieve[j] = false;
                    j += i;
                }
            }
        }

        let mut result = Vec::new();
        for &prime in &primes {
            let complement = n - prime;
            if complement >= prime && sieve[complement as usize] {
                result.push(vec![prime, complement]);
            }
        }

        result
    }
}
